import React from "react";

function Navbar () {
    return (
        <div className="navbar">
            <div className="container">
                <div className="navbar_container">
                    <ul className="navbar_left">
                        <div className="navbar_left-logo">
                            <img src="./Logo-L.png" alt="" />
                        </div>
                    </ul>
                </div>
            </div>
        </div>
    )
}

export default Navbar;
